import Link from 'next/link';


const linkStyle = {
    marginRight: 15
};

const Header = () => (
    <div>
        <Link href="/">
            <a style={linkStyle}>Home</a>
        </Link>
        <Link href="/about" >
            <a style={linkStyle} title="About Page" >About</a>
        </Link>
    </div>
)

export default Header;
